<template>
  <div>
    <img :src="imgSrc"/>
    <el-button @click="base64Down()">点击下载</el-button>
  </div>
</template>

<script>
    export default {
        name: "download",
        data() {
            return {
              imgSrc:"data:image/jpeg;base64,",

            }
        },
        created() {

        },
        mounted() {

        },
        methods: {
          base64Down(){
            var url = this.imgSrc;
            //base64转bolb对象
//						var blob = this.dataURLtoBlob(url);
            var blob = this.base64ToBlob(url);

            if (this.myBrowser() === "IE") { //IE  //|| myBrowser() === "Edge"
              //ie下载方式，ie不支持click事件
              window.navigator.msSaveBlob(blob, "图片名称.jpg")
            } else { //!IE
              url = window.URL.createObjectURL(blob);
              var odownLoad = document.createElement('a')
              odownLoad.href = url;
              odownLoad.download = "图片名称";
              odownLoad.click();
            }
          },
          //base64转bolb对象---方法1
          base64ToBlob(code) {
            let parts = code.split(';base64,');
            let contentType = parts[0].split(':')[1];
            let raw = window.atob(parts[1]);
            let rawLength = raw.length;

            let uInt8Array = new Uint8Array(rawLength);

            for (let i = 0; i < rawLength; ++i) {
              uInt8Array[i] = raw.charCodeAt(i);
            }
            return new Blob([uInt8Array], {type: contentType});
          },

          //base64转bolb对象---方法2
          dataURLtoBlob(dataurl) {
            var arr = dataurl.split(','), mime = arr[0].match(/:(.*?);/)[1],
              bstr = atob(arr[1]), n = bstr.length, u8arr = new Uint8Array(n);
            while (n--) {
              u8arr[n] = bstr.charCodeAt(n);
            }
            return new Blob([u8arr], { type: mime });
          },
          //判断浏览器方法
          //判断浏览器类型
          myBrowser() {
            var userAgent = navigator.userAgent; //取得浏览器的userAgent字符串
            var isOpera = userAgent.indexOf("OPR") > -1; if (isOpera) { return "Opera" }; //判断是否Opera浏览器 OPR/43.0.2442.991

            //if (userAgent.indexOf("compatible") > -1 && userAgent.indexOf("MSIE") > -1 && !isOpera) { return "IE"; }; //判断是否IE浏览器

            if (userAgent.indexOf("Firefox") > -1) { return "FF"; } //判断是否Firefox浏览器  Firefox/51.0
            if (userAgent.indexOf("Trident") > -1) { return "IE"; } //判断是否IE浏览器  Trident/7.0; rv:11.0
            if (userAgent.indexOf("Edge") > -1) { return "Edge"; } //判断是否Edge浏览器  Edge/14.14393
            if (userAgent.indexOf("Chrome") > -1) { return "Chrome"; }// Chrome/56.0.2924.87
            if (userAgent.indexOf("Safari") > -1) { return "Safari"; } //判断是否Safari浏览器 AppleWebKit/534.57.2 Version/5.1.7 Safari/534.57.2
          }
        }
    }
</script>

